import React, {useRef} from "react";
import './Navbar.css';
import resume from './../../../assets/Home/resume.pdf'

const Navbar = () =>{
    const Link = useRef(null);
    const executeScroll = (letter) =>
    letter.current.scrollIntoView({ behavior: "smooth", block: "center" });

  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="#about">Bang Pham</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link active" href="#about">ABOUT ME</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#projects">PROJECTS</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#resume">RESUME</a>
        </li>
        <li class="nav-item">
          <a class="nav-link disabled">CONTACT</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
  );
};

export default Navbar;
